import React from 'react';
import ReactDOM from 'react-dom';
import { Card } from 'react-bootstrap';
import './sentence.css';

class Sentence extends React.Component {
    render() {
    return (
        <Card className="sentence container">
        <Card.Body>
          <Card.Text>
          <p>מפגש של מסורת רבת שנים וקולינריה מודרנית סגנונית בצלחת שלך...האוכל שלנו הוא ביטוי של פריצת דרך כרמלית של המטעמים הדרוזים.</p>
          </Card.Text>
        </Card.Body>
      </Card>
    );
  }
}
export default Sentence
